import React from "react";
import "./styles/main.css";

function Queue(props) {
  return (
    <>
      <p className="queue__title">NEXT VIDEO</p>
      <ul className="queue">
        {props.queue.map((queue) => (
          <li key={queue.id} class="queue__video">
            <img
              className="queue__video--thumb"
              src={queue.image}
              alt="thumb"
            />
            <h2 className="queue__video--title">{queue.title}</h2>
            <span className="queue__video--channel">{queue.channel}</span>
          </li>
        ))}
      </ul>
    </>
  );
}

export default Queue;
